import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  let finalDiv = "";

  for (let i = 0; i < props.expenses.length; i++) {
    finalDiv += '<ExpenseItem title={props.expenses[i].title} amount={props.expenses[i].amount} date={props.expenses[i].date}/>';
    
  }

  return (<div>{finalDiv}</div>);
}

export default Expenses;
